    # Create a graph
    graph = [[0] * n for _ in range(n)]
    for a, b in roads:
        graph[a - 1][b - 1] = 1
        graph[b - 1][a - 1] = 1

    # Perform BFS to check connectivity
    def bfs(graph, start):
        visited = [False] * n
        queue = [start]
        visited[start] = True

        while queue:
            vertex = queue.pop(0)
            for i in range(n):
                if graph[vertex][i] == 1 and not visited[i]:
                    visited[i] = True
                    queue.append(i)

        return all(visited)

    # Check for connectivity
    if not bfs(graph, 0):
        return "0"

    # Find valid options
    valid_options = []
    for i in range(2 ** m):
        option = bin(i)[2:].zfill(m)
        if option.count("1") == n - 1:
            graph_copy = [row[:] for row in graph]
            for j in range(m):
                if option[j] == "0":
                    a, b = roads[j]
                    graph_copy[a - 1][b - 1] = 0
                    graph_copy[b - 1][a - 1] = 0
            if bfs(graph_copy, 0):
                valid_options.append(option)

    # Output the result
    if len(valid_options) < k:
        return "0"
    else:
