                return False
        return True

    def sort_array(a: list, p: set) -> list:
        n = len(a)
        for i in range(n - 1):
            if a[i] > a[i + 1] and (i + 1) in p:
                a[i], a[i + 1] = a[i + 1], a[i]
        return a

    def main(stdin: str) -> list:
