            p = set(map(int, lines[i + 2].split()))

            if n == m + 1:
                outputs.append("YES")
                continue

            if not can_sort(a, p, n):
                outputs.append("NO")
                continue

            sorted_a = sort_array(a, p)
            if is_sorted(sorted_a):
                outputs.append("YES")
