    def find_median(l):
        if l % 2 == 0:
            return (l // 2) - 1, (l // 2)
        else:
            return (l - 1) // 2

    def partition(arr, low, high):
        pivot = arr[high]
        i = low - 1
        for j in range(low, high):
            if arr[j] <= pivot:
                i += 1
                arr[i], arr[j] = arr[j], arr[i]
        arr[i + 1], arr[high] = arr[high], arr[i + 1]
        return i + 1

    def quick_select(arr, low, high, k):
        if low == high:
            return arr[low]

        pivot_index = partition(arr, low, high)
        if k == pivot_index:
            return arr[k]
        elif k < pivot_index:
            return quick_select(arr, low, pivot_index - 1, k)
        else:
            return quick_select(arr, pivot_index + 1, high, k)

    B = []
    for i in range(N):
        temp_X = X.copy()
        temp_X.pop(i)
        median_index_1, median_index_2 = find_median(len(temp_X))
        B_i = (quick_select(temp_X, 0, len(temp_X) - 1, median_index_1) + quick_select(temp_X, 0, len(temp_X) - 1, median_index_2)) / 2
        B.append(B_i)

    return '\n'.join(str(b) for b in B)

