def solution(stdin: str) -> str:
    s = stdin.strip()
    results = []

    def evaluate(formula: str) -> int:
        result = 0
        temp = 0
        for char in formula:
            if char.isdigit():
                temp = temp * 10 + int(char)
            else:
                result += temp
                temp = 0
        result += temp
        return result

    def backtrack(start: int, current_formula: str, current_result: int):
        if start == len(s):
            results.append(current_result)
        else:
            # Include the current digit
            if start > 0 and current_formula[-1] != '+':
                backtrack(start + 1, current_formula + s[start], current_result)

            # Add the '+' sign
            if start > 0 and s[start - 1] != '+':
                backtrack(start + 1, current_formula + '+', current_result)

            # Exclude the current digit
            backtrack(start + 1, current_formula, current_result + evaluate(s[start]))

    backtrack(0, "", 0)
    return str(sum(results))

