        def merge(line: list) -> list:
            result = []
            i = 0
            while i < len(line):
                if i == len(line) - 1 or line[i] != line[i + 1]:
                    result.append(line[i])
                    i += 1
                else:
                    result.append(line[i] * 2)
                    i += 2
            return result

        def pad_zeros(line: list) -> list:
            zeros = 4 - len(line)
            return line + [0] * zeros

        moved = []
        for line in board:
            merged = merge(line)
            moved.append(pad_zeros(merged))
        return moved

    def move_up(board: list) -> list:
        return move_left(transpose(board))

    def move_right(board: list) -> list:
        return reverse_rows(move_left(reverse_rows(board)))

    def move_down(board: list) -> list:
        return reverse_rows(move_up(reverse_rows(board)))

    def transpose(board: list) -> list:
        return [[board[j][i] for j in range(4)] for i in range(4)]

    def reverse_rows(board: list) -> list:
        return [line[::-1] for line in board]

    def read_input(stdin: str) -> tuple:
        lines = stdin.split('\n')
        board = [[int(x) for x in line.split()] for line in lines[:4]]
        direction = int(lines[4])
        return board, direction

    def write_output(board: list) -> str:
        return '\n'.join([' '.join([str(x) for x in line]) for line in board])

    board, direction = read_input(stdin)

    if direction == 0:
        moved = move_left(board)
    elif direction == 1:
        moved = move_up(board)
    elif direction == 2:
        moved = move_right(board)
    else:
        moved = move_down(board)

    return write_output(moved)

