    initial_heights = list(map(int, stdin.split('\n')[1].split()))

    pieces = {
        1: [(1, 0), (0, 1), (1, 1), (0, 2)],
        2: [(2, 0), (0, 1), (1, 1), (2, 1), (1, 2)],
        3: [(3, 0), (0, 1), (1, 1), (2, 1), (3, 1), (2, 2), (1, 3)],
        4: [(4, 0), (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (1, 2), (2, 2), (3, 2)],
        5: [(4, 0), (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (1, 2), (2, 2), (3, 2), (2, 3)],
        6: [(4, 0), (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (1, 2), (2, 2), (3, 2), (4, 2), (3, 3)],
        7: [(4, 0), (0, 1), (1, 1), (2, 1), (3, 1), (4, 1), (1, 2), (2, 2), (3, 2), (4, 2), (1, 3), (2, 3), (3, 3), (4, 3)]
    }

    def is_valid(field: List[int], x: int, y: int, width: int, height: int) -> bool:
        if x + width > C or y + height > len(field) or y + height < initial_heights[x]:
            return False
        for i in range(x, x + width):
            for j in range(y, y + height):
                if field[i + j * C] == 1:
                    return False
        return True

    def fill(field: List[int], x: int, y: int, width: int, height: int) -> None:
        for i in range(x, x + width):
            for j in range(y, y + height):
                field[i + j * C] = 1

    def backtrack(field: List[int], piece: int, x: int, y: int) -> int:
        if piece == 0:
            return 1

        ways = 0
        for rotation in range(4):
            width, height = pieces[piece][rotation]
            for i in range(-width + 1, C):
                for j in range(initial_heights[x] - height, len(field)):
                    if is_valid(field, x + i, y + j, width, height):
                        fill(field, x + i, y + j, width, height)
                        ways += backtrack(field, piece - 1, x + i + width - 1, y + j + height - 1)
                        for k in range(i, i + width):
                            for l in range(j, j + height):
                                field[k + l * C] = 0
        return ways

    field = [0] * (C * max(initial_heights))
    for i in range(C):
        for j in range(initial_heights[i]):
            field[i + j * C] = 1

    return str(backtrack(field, P, 0, 0))

